import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Posts from "./components/pages/Posts";
import PostBody from "./components/pages/PostBody";
import AddingArticle from "./components/pages/AddingArticle";
import Authrorize from "./components/pages/Authrorize";
import {useDispatch, useSelector} from "react-redux";



function App() {

    const dispatch = useDispatch();
    const user = useSelector(state => state.user)
    console.log(user);



    return (
       <>
           <BrowserRouter>
               <Routes>
                   <Route path={"/"} element={<Posts />} />
                   <Route path={"/addingArticle"} element={<AddingArticle />} />
                   <Route path={"/post/:postId"} element={<PostBody />} />
                    <Route path={"/login"} element={<Authrorize />}/>
               </Routes>
           </BrowserRouter>

       </>
    );
}

export default App;
